function ConfirmClick(n,t){n.preventDefault();$("#confirmDialog").dialog({autoOpen:!1,modal:!0,resizable:!1,buttons:{Confirm:function(){t()},Cancel:function(){$(this).dialog("close")}}});$("#confirmDialog").dialog("open")}function ConfirmClickGeneric(n){$("#exportDialog").dialog({autoOpen:!1,modal:!0,resizable:!1,buttons:{Confirm:function(){n()},Cancel:function(){$(this).dialog("close")}}});$("#exportDialog").dialog("open")}